import Footer from "./common/footer/Footer";
import Hero from "./components/hero/Hero";
const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <Navbar />
    <App />
    <Footer />
  </React.StrictMode>
);

reportWebVitals();
